What sorting alogrithm is used by mongodb's sort and nested array sort?<p>I am experimenting with MongoDB's <code>sort</code> performance to decide whether or not to store a user's location history <code>{ts: DATE(), location: "loc"}</code> (maxHistorySize=100) within the user object or in a separate collection. </p>

<p>My goal is to achieve better TPS. It's expected to have a lot more writes than reads.</p>

<p>The major concern I have right now is the performance of sorting (which I will need for querying and housekeeping, also while inserting(create index)).</p>

<p><strong>When stored within</strong>, the write query would be something like this. 
My concern is how quickly it can finish the sort.
Since the <code>$sort</code> run every time an insertion takes place, the array would be largely sorted already.
I am wonder whether the <code>sort</code> has a runtime of <code>O(log(n))</code> or <code>O(nlog(n))</code></p>

<pre><code>        update: {
          $setOnInsert: {userId: 'userId'},
          $push: {
            locations: {
              $each: [{location: 'location', ts: new Date()}],
              $slice: -100,
              $sort: {ts: 1}
            }
          },
</code></pre>

<p><strong>When stored separately</strong>, I would have to create an index on <code>ts</code>. Since MongoDB uses <code>B-tree</code> to create an index, I am guessing the overhead is just O(log(n)). The drawback is that it uses extra spaces.</p>

<p>I am not sure where, to begin with, any recommendations is appreciated. Thanks</p>

