Monix Task with Mongo Collection: Error handling<p>I am trying to use Monix <code>Task</code> with <code>mongo-scala-driver</code>. I have some trouble understanding <code>Error Handling</code> </p>

<pre><code>    val mongoClient: Resource[Task, MongoConnection[Task, DomainModel]] =
      MongoTypedConnection.create[Task, DomainModel](
        "mongodb:...&amp;authMechanism=SCRAM-SHA-1"
      )

    mongoClient.use { client =&gt;
      val changeStream: Task[ChangeStreamObservable[DomainModel]] =
        for {
          collection &lt;- client.getMongoCollection("myDatabase", "myCollection")
          changes    &lt;- client.watchCollection(collection)
        } yield changes
        ...
        ...
        ...
        .as(ExitCode.Success)
      }

</code></pre>

<p>This works perfectly well when there are no errors. I want to add error handling to this, (for example to handle incorrect <code>database</code> and <code>collection</code> names). My initial attempt based on the docs is to try:</p>

<pre><code>      val changeObs: io.Serializable =
        Await.result(changeStream
          .onErrorHandleWith {
            case _: TimeoutException =&gt;
              // Oh, we know about timeouts, recover it
              Task.now("Recovered!")
            case other =&gt;
              // We have no idea what happened, raise error!
              Task.raiseError(other)
          }.runToFuture, 5.seconds)
</code></pre>

<p>But this gives me an <code>io.Serializable</code>. How do I retain a <code>ChangeStreamObservable[DomainModel]</code> while also having some kind of neat error handling? Appreciate pointers to any patterns that I could study.</p>

<p>BR</p>

